@pytest.mark.parametrize("mode", ("HSV",))
# My theory is that LAB is only failing for old lcms2
# which will stop being a problem when amazon-2 becomes EOL on June 30
def test_histogram(mode: str) -> None:
    im = hopper()
    print("64-bit" if sys.maxsize > 2**32 else "32-bit")
    assert im.tobytes() == expected_data["RGB"]
    print(im.convert(mode).tobytes())
    assert im.convert(mode).tobytes() == expected_data[mode]
